import React, {Component} from 'react';
import classes from './SpectreTopBar.css';
import Radium from 'radium';
import spectreVide from '../../../assets/spectreVide.jpg';
import { Icon } from 'react-icons-kit';
import {caretUp} from 'react-icons-kit/fa/caretUp'

let fleche = null;
let style1 = {visibility: 'hidden'}
let style2 = {visibility: 'hidden'}
